# -*- coding: utf-8 -*-

from typing import List


class Solution:
    def max_line(self, matrix: List[List[str]], mark):
        line_length = max_line_length = 0
        for i in range(len(matrix[0])):
            if mark[i] and matrix[-1][i] == "1":
                line_length += 1
                max_line_length = max(max_line_length, line_length)
            else:
                line_length = 0
                mark[i] = 0
        return max_line_length * len(matrix), mark

    def maximalRectangle(self, matrix: List[List[str]]) -> int:
        """
        定位好高度后，对行进行动态规划判定
        :param matrix:
        :return:
        """
        if not matrix:
            return 0
        max_area = 0
        for i in range(len(matrix)):
            mark = [1] * len(matrix[0])
            for j in range(i+1, len(matrix)+1):
                v, mark = self.max_line(matrix[i:j], mark)
                if not v:
                    break
                max_area = max(max_area, v)
        return max_area


